    tmp.push(route[route.length - 1]);
    p.call(function () {
      this[2].posX = this[0];
      this[2].posY = this[1];
      this[3].getComponent('Cell').stepOnCell(this[2].node);
    }, tmp);
    p.start(); //this.avatar.setPosition(route[route.length-1].getPosition());
